const input = '';

const isInvert = (ch1, ch2) => {
    const ch1_code =  ch1.charCodeAt(0);
    const ch2_code =  ch2.charCodeAt(0);

    return Math.abs(ch2_code - ch1_code) === 32;
};

const removeUnit = (polymer, unit) => {
    const r = new RegExp(`${unit}`, 'gi');
    return polymer.replace(r, '');
}

const genCharArray = (charA, charZ) => {
    let a = [], i = charA.charCodeAt(0), j = charZ.charCodeAt(0);
    for (; i <= j; ++i) {
        a.push(String.fromCharCode(i));
    }
    return a;
}
genCharArray('a', 'z'); // ["a", ..., "z"]

const react = (str) => {
    const stack = [];

    input.split('').forEach((char, position) => {
        if (stack.length === 0) {
            stack.push(char);
        } else {
            const stackLast = stack.pop();
            const is = isInvert(char, stackLast);

            if (!is) {
                stack.push(stackLast);
                stack.push(char);
            }
        }
    });

    return stack;
};

